import React from "react";

const RenderCity=(props)=>{
    return(
        <div>
           <img src={`${props.image}`} alt={`${props.name}`}/>
           <h1>{props.name}</h1>
           <h2></h2>
        </div>
    )
};
export default RenderCity;
